import React from 'react'
import "./Watch.scss"
import ArrowBackIosNewOutlinedIcon from '@mui/icons-material/ArrowBackIosNewOutlined';

export default function Watch() {
  return (
    <div className='Watch'>
        <div className="back">
            <ArrowBackIosNewOutlinedIcon />
            <Link>
            Home
            </Link>
        </div>
        <video className='video' autoplay progress controls src="https://encrypted-vtbn0.gstatic.com/video?q=tbn:ANd9GcRhGuRGg8x8KIJnKHypaomq1_e8L2ABEM_zvw" />
    </div>
  )

}
